import React from 'react';

class ChilComponent extends React.Component{
 
    render (){
        //re-render
       let {arrJobs} = this.props;
        return (
       <>     
                <div>Show</div>            
                <div className='job-lists'>
                        {
                            arrJobs.map((item, index) => {
                                return(
                                <div key={item.id}>
                                    {item.title} - {item.salary}
                                </div> 
                                )
                            })
                        }
                </div>
                <div>Hide</div>
        </>
        )
    }
}
